//sneakernews.com/2022/09/14/air-jordan-37-low/",like:"3/5",time:"11 Mins",by:"Jared Ebanks",btn:"Read More"},{title:"Bros Nike Zoom Freak 4",text:"Arriving right time for the Fall, this upcoming take on the Zoom Freak 4 seemingly draws inspiration from Thanksgiving. Orange and brown, two staples of the holiday, are used throughout the upper, dressing the parts not bathed in shades of grey.",img:"https://sneakernews.com/wp-content/uploads/2022/09/nike-zoom-freak-4-ironstone-orange-trance-cobblestone-sail-dj6149-003-2.jpg?w=540&h=380&crop=1",time:"41 Mins",like:"5/5",url:"https://sneakernews.com/2022/09/14/nike-zoom-freak-4-ironstone-orange-trance-cobblestone-sail-dj6149-003/",by:"Michael Le",btn:"Read More"},{title:"Nike Air Max Plus",text:"The Nike Air Max Plus has enjoyed the reveal of several colorways these last few of months. And as we officially embark on the Fall season, an additional set have been added to the calendar, including this newly-revealed grey and orange colorway.",img:"https://sneakernews.com/wp-content/uploads/2022/09/Nike-Air-Max-Plus-FB3358-001-2.jpg?w=540&h=380&crop=1",time:"2 Hours",url:"https://sneakernews.com/2022/09/14/nike-air-max-plus-grey-orange-black-fb3358-001/",like:"5/5",by:"Michael Le",btn:"Read More"},{title:"Air Jordan Retro High OG",text:"Air Jordan Retro High OG popular series of AJ1s with the popular color-blocking with the original Yellow Toe flavor. The colorway was revealed back PE by musician Zach Myers, nearly four years later, Jordan fanatics will finally get their shot a GR release.",img:"https://sneakernews.com/wp-content/uploads/2022/03/yellow-toe-jordan-1-release-date-2.jpg",time:"7 Months",url:"https://sneakernews.com/2022/03/09/air-jordan-1-retro-high-og-yellow-toe-555088-711/",like:"5/5",by:"Sneaker News",btn:"Read More"},{title:"Nike Air Zoom GT Cut 2",text:"The Bred coloryway of Zoom GT Cut 2 will be first to release this Friday, For Nike Members Nation World Wide while Sabrina Ionescus colorway is set for an O